INSERT INTO `tours` (`id`, `nama_tempat`, `caption`, `deskripsi_tempat`, `gambar_katalog`, `harga`, `jadwal`, `jumlah_like`, `tema`) VALUES
(1, 'Tokyo Dome', '', 'Korakuen, yang ada di tengah Tokyo, punya banyak hal menarik walaupun ukurannya kecil. Di sini ada Tokyo Dome, stadion besar yang sering dipakai buat pertandingan baseball dan konser. Di sebelahnya, ada taman hiburan dan kompleks belanja yang cocok buat hiburan anak-anak maupun orang dewasa. Gak jauh dari situ, sekitar 1 km, ada Universitas Tokyo yang terkenal dengan bangunan dan pemandangannya yang fotogenik.\r\nJangan lupa mampir ke area Iidabashi yang punya spot menarik seperti Kagurazaka, kawasan belanja dan restoran yang keren, serta taman bersejarah Koishikawa Korakuen.', , 100000, '15 Desember2024', 82, 'Lain-lain');
INSERT INTO `tours` (`id`, `nama_tempat`, `caption`, `deskripsi_tempat`, `gambar_katalog`, `harga`, `jadwal`, `jumlah_like`, `tema`) VALUES
(4, 'Tsukiji Outer Market', '', 'Tsukiji dulunya adalah lokasi salah satu pasar ikan terbesar di dunia, yang pada masa jayanya menangani lebih dari 2.000 ton makanan laut segar setiap harinya. Meskipun fungsi grosir dan lelang tuna di pasar dalam telah dipindahkan ke Pasar Toyosu pada Oktober 2018, Pasar Luar Tsukiji tetap hidup dan ramai. Di sini, Anda akan menemukan komunitas pedagang yang menjual bahan makanan, peralatan dapur, hingga beberapa restoran terbaik di Tokyo yang masih beroperasi hingga kini. Tsukiji terletak di sebelah selatan Tokyo Station dan tepat di samping area Ginza. Anda dapat menggunakan Jalur Kereta Bawah Tanah Oedo untuk menuju Stasiun Tsukiji-Shijo atau Jalur Kereta Bawah Tanah Hibiya untuk menuju Stasiun Tsukiji.', , 100000, '20 Desember 2024', 72, 'Market');
INSERT INTO `tours` (`id`, `nama_tempat`, `caption`, `deskripsi_tempat`, `gambar_katalog`, `harga`, `jadwal`, `jumlah_like`, `tema`) VALUES
(5, 'Mt. Fuji', '', 'Gunung Fuji, dengan ketinggian 3.776 meter, adalah gunung tertinggi di Jepang. Tidak heran jika gunung berapi yang hampir sempurna bentuknya ini telah dipuja sebagai gunung suci dan menjadi inspirasi bagi seniman serta masyarakat umum selama berabad-abad. Gunung Fuji adalah gunung berapi aktif, dengan letusan terakhir terjadi pada tahun 1707. Gunung ini berada di perbatasan Prefektur Yamanashi dan Shizuoka, dan pada hari cerah dapat terlihat dari Tokyo dan Yokohama. Cara mudah lainnya untuk menikmati pemandangan Gunung Fuji adalah dari kereta saat melakukan perjalanan antara Tokyo dan Osaka. Jika Anda menaiki Tokaido Shinkansen dari Tokyo menuju Nagoya, Kyoto, atau Osaka, pemandangan terbaik Gunung Fuji dapat dinikmati sekitar 40-45 menit perjalanan, di sisi kanan kereta, tepatnya di sekitar Stasiun Shin-Fuji.', , 100000, '13 Desember 2024', 55, 'Gunung');
INSERT INTO `tours` (`id`, `nama_tempat`, `caption`, `deskripsi_tempat`, `gambar_katalog`, `harga`, `jadwal`, `jumlah_like`, `tema`) VALUES
(6, 'Yangtze', '', 'Starting in Beijing and ending in Shanghai, this 13-day tour will show you the best of China. You will hike the Great Wall and experience the traditional Hutong lifestyle in the capital city, marvel at the Terracotta Warriors and walk around the Muslim Street in Xi\'an, and admire the natural beauty of Li River and Reed Flute Cave in Guilin. What else? View the impressive Three Gorges Dam by the Yangtze River Cruise, and explore the city highlights of Shanghai.', , 100000, '0000-00-00', 72, 'Alam, Budaya, Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `caption`, `deskripsi_tempat`, `gambar_katalog`, `harga`, `jadwal`, `jumlah_like`, `tema`) VALUES
(7, 'Tibet', '', 'Take this leisurely tour delving into China\'s rich history, captivating culture, and breathtaking scenery. You can ascend the magnificent Great Wall comfortably via cable car. With a battery automobile, explore the army of Terracotta Warriors. Relax on a Li River cruise while admiring some of the world\'s most beautiful karst landforms. Ride a boat on Hangzhou West Lake\'s smooth water and experience the unique waterside scenery of Wuzhen. Stroll through the old streets of Shanghai to uncover its cosmopolitan allure.', , 100000, '0000-00-00', 79, 'Alam, Budaya, Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `caption`, `deskripsi_tempat`, `gambar_katalog`, `harga`, `jadwal`, `jumlah_like`, `tema`) VALUES
(8, 'Hongkong', '', 'Beyond the must-visit golden triangle cities: Beijing, Xi\'an, and Shanghai, this 11-day tour also extends to Zhangjiajie. Besides historical sites like Great Wall, the Forbidden City, Terracotta Warriors, Hanyang Tomb, and the colonial Bund, you will enjoy Zhangjiajie\'s stunning scenery. Explore the Avatar Mountains in the National Forest Park, and have a thrilling walk on the glass walkways in Tianmen Shan National Forest Park.', , 150000, '0000-00-00', 76, 'Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `caption`, `deskripsi_tempat`, `gambar_katalog`, `harga`, `jadwal`, `jumlah_like`, `tema`) VALUES
(9, 'Silk Road', '', 'A Silk Road tour in China\'s wild west is always exciting and can even change your life. Follow the ancient trade route that connected the East and West to learn about its colorful history, interesting culture, and beautiful landscapes. See amazing sights like the Terracotta Warriors in Xian. t Our Silk Road tours offer an unforgettable adventure and are designed for comfort, making sure everyone will enjoy their Silk Road travel experience. ', , 75000, '0000-00-00', 94, 'Modern, Budaya, Festival');
INSERT INTO `tours` (`id`, `nama_tempat`, `caption`, `deskripsi_tempat`, `gambar_katalog`, `harga`, `jadwal`, `jumlah_like`, `tema`) VALUES
(10, 'Foodies', '', 'Beyond the must-visit golden triangle cities: Beijing, Xi\'an, and Shanghai, this 11-day tour also extends to Zhangjiajie. Besides historical sites like Great Wall, the Forbidden City, Terracotta Warriors, Hanyang Tomb, and the colonial Bund, you will enjoy Zhangjiajie\'s stunning scenery. Explore the Avatar Mountains in the National Forest Park, and have a thrilling walk on the glass walkways in Tianmen Shan National Forest Park.', , 50000, '0000-00-00', 64, 'Modern, Budaya, Festival');

